import React from "react";
import "./footer.css";
const FOOTCON = () => {
  return (
    <>
      <div class="info">
        <div class="descrption">
          <h1 class="titlePage">THABER</h1>
          <p class="paragraph">
            An education platform for teaching programming <br />
            languages,which include lectures,codes and videos,
            <br />
            and allows users to chat <br />
          </p>
        </div>
      </div>

      <div class="parent-line">
        <div class="line"></div>
      </div>
    </>
  );
};
export default FOOTCON;
